import React from "react";

function Podcast(){
    return(
        <div className="podcastDiv">
            <h1>Screen Spew</h1>
            <img src={require("../imgs/screen-spew.jpg")} alt="cover picture for screen spew" />
            <p>How to listen!</p>
            <a><img /></a>
        </div>
    );
}

export default Podcast;
